import React, {Component, useEffect, useState} from "react";

export default function Home(){
    const [data, setData] = useState(null);

    useEffect(()=>{
        const client = JSON.parse(sessionStorage.getItem("client"));
        console.log(client)
        if (client == null) {
            window.location.href = "/"
        }
    }, [])



    if (!data){
        return (
            <div className="preloader">
                <div className="loader">
                    <span></span>
                    <span></span>
                    <span></span>
                    <span></span>
                </div>
            </div>
        )
    }else{
        return (
            <div className="table-wrapper">
                <table className="eg-table order-table table mb-0">
                    <thead>
                    <tr>
                        <th>Bidding ID</th>
                        <th>Date</th>
                        <th>Prix depart</th>
                        <th>Status</th>
                        <th>Action</th>
                    </tr>
                    </thead>
                    <tbody>
                    {data.map(auction =>
                        <tr key={auction.id}>
                            <td>{auction.id}</td>
                            <td>{auction.dateDebut}</td>
                            <td>Ar{auction.prixMin}</td>
                            <td className="text-green">finish</td>
                            <td>
                                <button className="eg-btn action-btn green" id={auction.id} onClick={click}>Details</button>
                            </td>
                        </tr>
                    )}
                    </tbody>
                </table>
            </div>
        )
    }
}
